import React from 'react';
import './App.css';


class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0
    }
  }

  render() {
    return (
      <>
      <h1>{this.state.counter}</h1>
      </>)
  }
}

function App() {
  return (
    <Counter />
  );
}

export default App;
